import { useEffect, useState } from "react";
import { Link ,useParams} from "react-router-dom";

function AddCart(){

    const [data, setData] = useState([])
    const{cart}=useParams()

    useEffect(()=>{
    
        fetch("http://localhost:3005/empData/"+cart)
        .then((res)=>{
            return res.json()
        })
        .then((resp)=>{
            setData(resp)
            // console.log(resp)
        })
    },[])

    
    useEffect(()=>{
    
        fetch("http://localhost:3005/E-commerce/"+cart)
        .then((res)=>{
            return res.json()
        })
        .then((resp)=>{
            setData(resp)
            // console.log(resp)
        })
    },[])
 


    
    return(
        <div className="container mt-3">
        <div className="card">
            <div className="card-title text-center pt-2">
                <h3>Employe Management System</h3>
            </div>
            <div className="card-body">


                <table class="table table-bordred">
                    <thead>
                        <tr>
                            <th scope="col">ID</th>
                            <th scope="col">Name</th>
                            <th scope="col">Email</th>
                            <th scope="col">City</th>
                            
                        </tr>
                    </thead>
                    <tbody>

                   
                                <tr>
                                    <td>{data.id}</td>
                                    
                                  
                                </tr>

                           




                    
                   
                      
                    </tbody>

                </table>
                <Link to="/" className="btn btn-success ">
                Back
                </Link>
            </div>
        </div>

    </div>

    )
}
export default AddCart;
